import React from 'react';
import staticProjects from "../constants/staticProjects";

class SingleWork extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id: this.props,
            works: staticProjects(),
        };
    }

    componentDidMount = () => {
        console.log(this.props);
    }

    render(){
        const work = this.state.works.find(({ id }) => id === this.state.id.match.params.topicId)
        return (
            <div className={'single-work-page'}>
                <p> This is a single work page  {work.id}</p>
            </div>
        )
    }
}

export default SingleWork;
